import React, { useEffect } from 'react'
import  getRaceDetail from '../../Redux/actions';
import { useDispatch, useSelector } from 'react-redux';
import { Link } from 'react-router-dom';
import fondoDefault from '../../img/fondohome1.jpg';



const dogDetail = () => {

const dispatch = useDispatch();
const raceDetail = useSelector(state => state.raceDetail)

const id = props.match.params.id;


useEffect(() =>{
dispatch(getRaceDetail(id))
}, [dispatch, id])


  return (
    <div key={id}>
    <div>
    <Link to='/home' id="click">
    <button >Volver a Home</button>
    </Link>
    </div>
        {raceDetail.length > 0}
        <div>
       <img src={raceDetail[0].image? raceDetail[0].image : fondoDefault} alt={raceDetail.name}/>

       </div>
    </div>
  )
}

export default dogDetail;
